import React from 'react'

export default function Banner({ children, title, subtitle }) {
    return (
        <div className="banner" style={{ margin: '5px', padding: '5px' }}>
            <h1>{title}</h1>
            <div />
            <p>{subtitle}</p>
            {children}
        </div>
    )
}
